import React from 'react';
import {Grid, Cell} from 'react-mdl';

export default class Form extends React.Component {
  state = {
    firstName: '',
    lastName: '',
    email: '',
    phone: '',
    message: '',
  }

  change = (e) => {
    this.setState({
      [e.target.name]: e.target.value
    })
  }

  onSubmit = e => {
    e.preventDefault();
    this.props.onSubmit(this.state);
    console.log(this.state);
    this.setState({
      firstName: '',
      lastName: '',
      email: '',
      phone: '',
      message: '',
      }
    )
  }


  render() {
    return (
      <Grid>
        <Cell col = {6}>
        </Cell>

        <Cell col = {6}>
        </Cell>
      </Grid>

    )
  }
}
